function SmallArrowIcon({ className }) {
  return (
    <svg width="10" height="21" x="0" y="0" viewBox="0 0 10 21">
      <path
        className={className}
        d="M1 15.75l5.2-5.2L1 5.35l1.5-1.5 6.5 6.7-6.6 6.6-1.4-1.4z"
      ></path>
    </svg>
  );
}

export default SmallArrowIcon;
